import styleCss from "./style.module.css";
import React from 'react';
import { Modal, Button, } from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';

function Login(props) {
    return (
        <Modal
            {...props}
            size="lg"
            aria-labelledby="contained-modal-title-vcenter"
            centered
        >
            <div>
                <form className={styleCss.form}>
                    <div className={styleCss.formGroup}>
                        <h1 className={styleCss.header}>Sign In</h1>
                        <input
                            className={styleCss.inputGroup}
                            id="email"
                            placeholder="Email"
                            type="email"
                        />

                        <input
                            className={styleCss.inputGroup1}
                            id="password"
                            placeholder="Password"
                            type="password"
                        />

                        <button className={styleCss.button} >Sign In</button>
                        <p className={styleCss.text}>Don't have an account? Klik Here</p>
                    </div>
                </form>
            </div>
        </Modal>
    );
}

function Ahri() {
    const [modalShow, setModalShow] = React.useState(false);

    return (
        <div>
            <div className={styleCss.back}>
                <img src="assets/background.png" className={styleCss.latar} alt="Logo" />

                <img src="assets/icon.png" className={styleCss.icon} alt="Logo" />

                <div className={styleCss.content}>
                    <p className={styleCss.text1}>
                        Sign-up now and subscribe to enjoy all the cool<br />
                        and latest books - The best book rental service<br />
                        provider in Indonesia
                    </p>
                    <button onClick={() => setModalShow(true)} className={styleCss.signUp}>Sign Up</button>
                    <button onClick={() => setModalShow(true)} className={styleCss.signIn}>Sign In</button >
                </div>
            </div>
        
        <>
            

            <loginPop
                show={modalShow}
                onHide={() => setModalShow(false)}
            />
        </>
            
        </div>
    );
}
export default Ahri;
